import React from "react";
import {
  AppBar,
  Toolbar,
  Button,
  Box,
  Typography,
  Container,
  useState,
} from "@mui/material";
import { Home, Info, Login } from "@mui/icons-material";
import "./App.css";

function App() {
  const [showAbout, setShowAbout] = useState(false);
  return (
    <div className="app-container">
      {/* Material UI Navigation Bar */}
      <AppBar
        position="fixed"
        sx={{ backgroundColor: "white", boxShadow: "none" }}
      >
        <Container maxWidth="lg">
          <Toolbar sx={{ justifyContent: "flex-end" }}>
            <Box sx={{ display: "flex", gap: 2 }}>
              <Button
                variant="contained"
                color="inherit"
                startIcon={<Home />}
                sx={{
                  color: "#537955",
                  backgroundColor: "transparent",
                  "&:hover": {
                    color: "#e95d4d",
                    backgroundColor: "transparent",
                  },
                }}
              >
                Home
              </Button>
              <Button
                variant="contained"
                color="inherit"
                startIcon={<Login />}
                sx={{
                  color: "#537955",
                  backgroundColor: "transparent",
                  "&:hover": {
                    color: "#e95d4d",
                    backgroundColor: "transparent",
                  },
                }}
              >
                Sign In
              </Button>
              <Button
                variant="contained"
                color="inherit"
                startIcon={<Info />}
                sx={{
                  color: "#537955",
                  backgroundColor: "transparent",
                  "&:hover": {
                    color: "#e95d4d",
                    backgroundColor: "transparent",
                  },
                }}
              >
                About Us
              </Button>
              <Button
                variant="contained"
                sx={{
                  color: "#537955",
                  backgroundColor: "transparent",
                  "&:hover": {
                    color: "#e95d4d",
                    backgroundColor: "transparent",
                  },
                }}
              >
                Contact Us
              </Button>
            </Box>
          </Toolbar>
        </Container>
      </AppBar>

      {/* Main Content */}
      <Container sx={{ mt: 12, textAlign: "center" }}>
        <div className="content-container">
          <h1 className="title">Bloom Well</h1>
          <h4 className="tagline">
            "When things change inside you, things change around you"
          </h4>
          <img src="/background.jpg" alt="Mind Blooming" className="bg-image" />
        </div>
      </Container>
    </div>
  );
}

export default App;
